export const fetchApi = async uri => {
	console.log(uri)
	const anotherRequest = new Request(uri, {
		'method': 'GET',
		'mode': 'no-cors',
	}).then(res => {
		console.log(res, 'abnother req')
	})
	fetch(uri, {
		'method': 'GET',
		'mode': 'no-cors',
	})
		.then(res => {
			console.log(res.body)
			return res;
		})
}
